import {Container,Nav,Navbar,Row,Col} from 'react-bootstrap';
import './App.css';
import { useState } from 'react';
import data from './data.js';
import { Routes,Route,Link,Outlet } from 'react-router-dom';

function App() {

  let [modal,setModal]=useState(false);
  let [shoes]=useState(data);
  return (   

    <div className="App">

<Navbar className="Header" bg="dark" data-bs-theme="dark">
        <Container>
          <Navbar.Brand href="/">Navbar</Navbar.Brand>
          <Nav className="me-auto">
            <Nav.Link href="/">Home</Nav.Link>
            <Nav.Link href="detail">Detail</Nav.Link>
            <Nav.Link href="about">About</Nav.Link>
            <Nav.Link>뒤로가기</Nav.Link>
          </Nav>
        </Container>
      </Navbar>
      <Routes>
        <Route path ="/" element={<body className="Body">
        <h4>OUTWEAR</h4> 
        <hr></hr>
        <button onClick={()=>setModal(!modal)} aria-expanded="false" aria-controls="refinement-wrap">Filters &amp; sort by<i></i></button>
        {modal==true?<Modal></Modal>:null}
        <hr></hr>
        <button className="Tag">태그 X</button>
        <Container>
          <Row>
            <Col><div className="Item">
              <img src="https://codingapple1.github.io/shop/shoes1.jpg" width="80%"/>
              <h4>{shoes[0].title}</h4>
              <p>{shoes[0].price}</p>
              </div></Col>
            <Col className='Itemimg'>2</Col>
            <Col><Card shoes={shoes[2]} i={3}/></Col>
          </Row>
          <Row>
            <Col>4</Col>
            <Col>5</Col>
            <Col>6</Col>
          </Row>
        </Container>
      </body>}/>
        <Route path="/detail" element={<Detail/>}>
          <Route  path="member" element={<Member/>}/>
        </Route>
        <Route path="/about" element={<About/>}>
          <Route path="location" element={<Location/>}></Route>
        </Route>
      </Routes>      
    </div>
  );
}

function Modal(){
  return(
    <div className="Modal">
      <p>스타일 선택</p>
      <p>색상 선택</p>
      <p>sort</p>
    </div>
  )
}

function Card(props){
  return(
  <div className="Item">
    <img src={'https://codingapple1.github.io/shop/shoes' + props.i +'.jpg'} width="80%"/>
    <h4>{props.shoes.title}</h4>
    <p>{props.shoes.price}</p>
  </div>
  )
}

function About(){
  return(
    <div>about페이지임
      <Outlet></Outlet>
    </div>
  )
}

function Detail(){
  return(
    <div>detail페이지임
      <Outlet></Outlet>
    </div>
  )
}

function Member(){
  return(
    <div>member페이지임</div>
  )
}
function Location(){
  return(
    <div>location페이지임</div>
  )
}
export default App;
